import React, { Component } from 'react';
import { Card } from 'semantic-ui-react'
import axios from 'axios'

class UserCard extends Component {
	constructor(){
		super()
		this.state ={
			detail: []
		}
	}


	render(){
		console.log(this.props)
		return(
			<Card>
				<Card.Content>
					<Card.Header> {this.state.detail.data} </Card.Header>
					<Card.Meta> Followers: {this.state.detail.data} </Card.Meta>
				</Card.Content>
			</Card>
			)
	}
}

export default UserCard;
